import React from "react";
import "./footer.css";

const Footer = () => {
  return (
    <footer className="footer">
      <p>
        &copy; {new Date().getFullYear()} Tu Nombre o Nombre de la Empresa.
        Todos los derechos reservados.
      </p>
    </footer>
  );
};

export default Footer;
